def get_scale(screen=0):
	w = int(CONF[screen]['w'])
	h = int(CONF[screen]['h'])
	w = w - 400
	h = h - 200
	sw = w / vw
	sh = h / vh
	if sw >= sh:
		scale = sh
	elif sw <= sh:
		scale = sw
	CONF['VIDEO_SCALE'] = scale
	writeConf()


